        [[Souper]]\n\n{{Beispiele}}\n:[1] Zum ''''Abendessen'''' gibt es heute einen
        besonders guten Wein.\n:[1] W\u00e4hrend des ''''Abendessens'''' m\u00f6chten
        wir nicht gest\u00f6rt werden.\n:[1] Die ''''Abendessen'''' fallen bei uns
        nicht so reichhaltig aus wie die anderen Mahlzeiten.\n:[1] \u201eDie abendlichen
