        radeln musste.\u201c<ref> Annette Birschel: ''''Mordsgouda. Als Deutsche unter
        Holl\u00e4ndern.'''' Ullstein, Berlin 2011, Zitat Seite 197. ISBN 978-3-548-28201-5.</ref>\n:[1]
        \u201eEs macht ihm anscheinend nichts aus, da\u00df er zum Fr\u00fchst\u00fcck
